import { Url } from 'url';
import './Navbar.css';

export interface NavbarItems {
    displayText: string;
    // TODO: This should idealy be Url type
    src: string;
}

const NavbarItems : NavbarItems[] = [
    {
        displayText: "Explore",
        src: "./index.html"
    },
    {
        displayText: "Create",
        //TODO: MISSING
        src: ""
    }
]

function Navbar(props : NavbarItems) {
    return ( 
        <div className='wrapper'>
            <ul>
                <li><img src={props.src} /></li>
                {NavbarItems.map((item) => {
                    return <Navbar {...item}/>
                })}
                <li><img src={props.src} /></li>
            </ul>
        </div> );
}

export default Navbar;
